/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[22];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(conv2d_s(&conv1d_config), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(maxpool_s(&max_pooling1d_config), layer[2]);
	layer[4] = model.hook(conv2d_s(&conv1d_1_config), layer[3]);
	layer[5] = model.hook(conv2d_s(&conv1d_2_config), layer[3]);
	layer[6] = model.active(act_relu(), layer[4]);
	layer[7] = model.active(act_relu(), layer[5]);
	layer[8] = model.hook(maxpool_s(&max_pooling1d_3_config), layer[3]);
	layer[9] = model.hook(maxpool_s(&max_pooling1d_1_config), layer[6]);
	layer[10] = model.hook(maxpool_s(&max_pooling1d_2_config), layer[7]);
	layer[11] = model.mergex(concat_s(&concatenate_config), 3 ,layer[9] ,layer[10] ,layer[8]);
	layer[12] = model.hook(conv2d_s(&conv1d_3_config), layer[11]);
	layer[13] = model.active(act_relu(), layer[12]);
	layer[14] = model.hook(maxpool_s(&max_pooling1d_4_config), layer[13]);
	layer[15] = model.hook(rnn_s(simple_cell_s(&rnn_simple_cell_config), &rnn_config), layer[14]);
	layer[16] = model.hook(flatten_s(&flatten_config), layer[15]);
	layer[17] = model.hook(dense_s(&dense_config), layer[16]);
	layer[18] = model.active(act_relu(), layer[17]);
	layer[19] = model.hook(dense_s(&dense_1_config), layer[18]);
	layer[20] = model.hook(softmax_s(&softmax_config), layer[19]);
	layer[21] = model.hook(output_s(&output_config), layer[20]);
	model_compile(&model, layer[0], layer[21]);
	return &model;
}
